import { Handle, Position } from 'reactflow';

export function InputNode({ id, data }) {
  return (
    <div className="node input-node">
      <h4>Input Node</h4>

      <input
        placeholder="Enter value"
        value={data.value || ''}
        onChange={(e) => {
          data.onChange('value', e.target.value);
        }}
      />

      <Handle type="source" position={Position.Right} />
    </div>
  );
}
